    <style>
      .letter {
        display: inline-block;
      }
      .tricksword {
        white-space: nowrap;
      }
    </style>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/animejs/2.0.2/anime.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/protonet-jquery.inview/1.1.2/jquery.inview.min.js"></script>

    <script>
      // Copyright start
      //  Code by T.RICKS, https://www.tricksdesign.com/
      // You have the license to use this code in your projects but not redistribute it to others

      // Find all text with .tricks class and break each letter into a span
      var tricksWord = document.getElementsByClassName("tricks");
      for (var i = 0; i < tricksWord.length; i++) {
        var wordWrap = tricksWord.item(i);
        wordWrap.innerHTML = wordWrap.innerHTML.replace(
          /(^|<\/?[^>]+>|\s+)([^\s<]+)/g,
          '$1<span class="tricksword">$2</span>'
        );
      }

      var tricksLetter = document.getElementsByClassName("tricksword");
      for (var i = 0; i < tricksLetter.length; i++) {
        var letterWrap = tricksLetter.item(i);
        letterWrap.innerHTML = letterWrap.textContent.replace(
          /\S/g,
          "<span class='letter'>$&</span>"
        );
      }
      // Copyright end

      // Slide In Animation
      var slideIn = anime.timeline({
        loop: false,
        autoplay: false,
      });

      slideIn
        .add({
          targets: ".slide-in .letter",
          opacity: [0, 1],
          easing: "easeInOutQuad",
          duration: 2250,
          delay: (el, i) => 150 * (i + 1),
        })
        .add({
          targets: ".slide-in",
          opacity: 0,
          duration: 1000,
          easing: "easeOutExpo",
          delay: 1000,
        });

      // Slide Up Animation
      var slideUp = anime.timeline({
        loop: false,
        autoplay: false,
      });

      slideUp
        .add({
          targets: ".slide-up .letter",
          translateY: ["1.1em", 0],
          opacity: [0, 1],
          translateZ: 0,
          duration: 750,
          delay: (el, i) => 50 * i,
        })
        .add({
          targets: ".slide-up",
          opacity: 0,
          duration: 1000,
          easing: "easeOutExpo",
          delay: 1000,
        });

      // Fade Side Menu Animation
      var fadeSide = anime.timeline({
        loop: false,
        autoplay: false,
      });

      fadeSide.add({
        targets: ".side-menu-text-wrap",
        translateX: [100, 0],
        translateZ: 0,
        opacity: [0, 1],
        easing: "easeOutExpo",
        duration: 1400,
        delay: (el, i) => 300 + 30 * i,
      });

      // Rotate In Animation
      var rotateIn = anime.timeline({
        loop: false,
        autoplay: false,
      });

      rotateIn
        .add({
          targets: ".rotate-in .letter",
          translateY: ["1.1em", 0],
          translateX: ["0.55em", 0],
          translateZ: 0,
          rotateZ: [180, 0],
          duration: 750,
          easing: "easeOutExpo",
          delay: (el, i) => 50 * i,
        })
        .add({
          targets: ".rotate-in",
          opacity: 0,
          duration: 1000,
          easing: "easeOutExpo",
          delay: 1000,
        });

      // Pop In Animation
      var popIn = anime.timeline({
        loop: false,
        autoplay: false,
      });

      popIn
        .add({
          targets: ".pop-in .letter",
          scale: [0, 1],
          duration: 1500,
          elasticity: 600,
          delay: (el, i) => 45 * (i + 1),
        })
        .add({
          targets: ".pop-in",
          opacity: 0,
          duration: 1000,
          easing: "easeOutExpo",
          delay: 1000,
        });

      // Play your animation with these

      // Wait before playing animation
      setTimeout(() => {
        // Put the play below this line
        fadeSide.play();
      }, 500);

      // Play animaton when something is clicked
      $(".menu-button").click(function () {
        fadeSide.play();
        fadeSide.restart();
      });

      // Play animaton when hovered in
      $(".your-button-class").mouseenter(function () {
        // Put the play below this line
      });

      // Play animation when scrolled into view
      $("#heading-container").on("inview", function (event, isInView) {
        if (isInView) {
          // Put the play below this line
        } else {
        }
      });
